import React from "react";

class CalcOut extends React.Component {
    render() {
        return (
            <div class="Calculator out">
                <input id="num1" class="form-control" type="text" placeholder="number one" readonly></input>
                <input id="op" class="form-control" type="text" placeholder="operation" readonly></input>
                <input id="num2" class="form-control" type="text" placeholder="number two" readonly></input>
                <input id="Result" class="form-control" type="text" placeholder="Result" readonly></input>
            </div>
        );
    }
}

export default CalcOut
